const TaskCard = () => {
    return (  
        <div className="taskcard_main">
            <button className="taskcard_button"></button>
            <div>
                <h3 className="taskcard_title">Task Title</h3>
                // h3.taskcard_
                <p className="taskcard_desc">Task description</p>
                <p className="taskcard_deadline">Deadline</p>
            </div>
        </div>
    );
}

export default TaskCard;
